	Session.prototype.compile = function () {
		var str,
		    obj = [],
		    rules;
		for (var _indicator in this.rules) {
			var indicator = this.rules[_indicator];
			rules = [];
			str = "\"" + _indicator + "\": [";
			for (var i = 0; i < indicator.length; i++) {
				rules.push(indicator[i].compile());
			}
			str += rules.join();
			str += "]";
			obj.push(str);
		}
		return "{" + obj.join() + "};";
	};

